import React from "react"
import './App.css';
import GameButton from "./packages/GameButton";

const App = () => {
  const board = () => {
    for (let i = 0; i < 2; i++) {
      return <GameButton label={"kupa"}/>
    }
  }

  return (
    <div className="App">
      {board}
    </div>
  );
}

export default App;
